void View_TouchTest(){
    uint32_t Pos_LastTap[2] = {0xFFFFFFFF, 0xFFFFFFFF};
    uint32_t Pos_UpdateArea[2];
    uint32_t Size_UpdateArea[2];
    tp_finger_t Pos_Tapped;

    pinMode(M5EPD_KEY_LEFT_PIN, INPUT);

    while(true){
        M5.TP.update();
        M5.update();
        Pos_Tapped = M5.TP.readFinger(0);

        //Serial.printf("x: %u,y: %u", Pos_Tapped.x, Pos_Tapped.y);

        if(M5.BtnL.wasReleased() == true){
            M5.EPD.UpdateCount();
        }

        if(
            (Pos_Tapped.x < 540 && Pos_Tapped.x < 960) &&
            (Pos_LastTap[0] != Pos_Tapped.x || Pos_LastTap[1] != Pos_Tapped.y)
        ){
            M5.EPD.FillPartGram4bpp(Pos_LastTap[0] - 50, Pos_LastTap[1] - 50, 100, 100, 0xFFFF);
            M5.EPD.FillPartGram4bpp(Pos_Tapped.x - 50, Pos_Tapped.y - 50, 100, 100, 0x0000);

            Pos_UpdateArea[0] = (Pos_LastTap[0] < Pos_Tapped.x) ? Pos_LastTap[0] : Pos_Tapped.x;
            Pos_UpdateArea[1] = (Pos_LastTap[1] < Pos_Tapped.y) ? Pos_LastTap[1] : Pos_Tapped.y;
            Pos_UpdateArea[0] = ((int)Pos_UpdateArea[0] - (int)50 < 0) ? 0 : Pos_UpdateArea[0] - 50;
            Pos_UpdateArea[1] = ((int)Pos_UpdateArea[1] - (int)50 < 0) ? 0 : Pos_UpdateArea[1] - 50;

            Size_UpdateArea[0] = abs((int)Pos_LastTap[0] - (int)Pos_Tapped.x) + 110;
            Size_UpdateArea[1] = abs((int)Pos_LastTap[1] - (int)Pos_Tapped.y) + 110;

            M5.EPD.UpdateArea(Pos_UpdateArea[0], Pos_UpdateArea[1], Size_UpdateArea[0], Size_UpdateArea[1], UPDATE_MODE_DU);
            
            Pos_LastTap[0] = Pos_Tapped.x;
            Pos_LastTap[1] = Pos_Tapped.y;
        }
    }
}

void handler(ChainArray queries, ChainArray requests, String *response, WiFiClient *client){
    String test = requests.get("body");

    requests.showKeys(true);
    Serial.printf("[0] %hhu\n[1] %hhu\n", test[0], test[1]);
    //Serial.println(test);
    //SD.open(, "w");

    *response = "Success";
}

